import Head from "next/head";
import React, { useState, useEffect } from "react";
import TableRecords from "../src/components/TableRecords";
import { Posts, Filtrar } from "../src/services/requests";
import { updateParameter } from "../src/helpers/update";

import Logo from "../src/components/Logo";
import Axios from "axios";

function Page({ registros, filtrar, query }) {
  const url = "https://aguaviva-rp.firebaseio.com/movimentacoes.json";

  function teste() {
    useEffect(() => {
      Axios.get(url).then((res) => {
        console.log(res);
      });
    }, []);
  }
  return (
    <>
      <div>teste</div>
    </>
  );
}

export default Page;
